[{"location":"#XMLParser.jl","page":"Home","title":"XMLParser.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"A lightweight XML parser which is purely written in Julia.","category":"page"},{"location":"","page":"Home","title":"Home","text":"For extensive use of XML features, consider using one of the following XML-libraries: LightXML.jl, EzXML.jl.","category":"page"},{"location":"#Install","page":"Home","title":"Install","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"import Pkg\nPkg.add(\"XMLParser\")","category":"page"},{"location":"#Unsupported-features","page":"Home","title":"Unsupported features","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"It is not allowed to use one of the following characters in XML content: <,>","category":"page"},{"location":"","page":"Home","title":"Home","text":"There are probably many more XML features that are not supported at the moment.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"#Types","page":"Home","title":"Types","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"XMLAttribute\nXMLTag\nXMLEmptyTag\nXMLElement","category":"page"},{"location":"#XMLParser.XMLAttribute","page":"Home","title":"XMLParser.XMLAttribute","text":"XMLAttribute\n\nCreates a XML attribute key-value-pair\n\nXMLAttribute(key::String, val::String)\n\n\n\n\n\n","category":"type"},{"location":"#XMLParser.XMLTag","page":"Home","title":"XMLParser.XMLTag","text":"XMLTag <: AbstractXMLTag\n\nCreates a XML tag\n\nXMLTag(name::String, attributes::Vector{XMLAttribute})\n\n\n\n\n\n","category":"type"},{"location":"#XMLParser.XMLEmptyTag","page":"Home","title":"XMLParser.XMLEmptyTag","text":"XMLEmptyTag <: AbstractXMLTag\n\nCreates a XML emptytag\n\nXMLEmptyTag(name::String, attributes::Vector{XMLAttribute})\n\n\n\n\n\n","category":"type"},{"location":"#XMLParser.XMLElement","page":"Home","title":"XMLParser.XMLElement","text":"XMLElement\n\nCreates a XML element\n\nXMLElement(tag::AbstractXMLTag, content::Vector{Any})\n\n\n\n\n\n","category":"type"},{"location":"#Functions","page":"Home","title":"Functions","text":"","category":"section"},{"location":"#Utils","page":"Home","title":"Utils","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"getElements!\ngetElements\ngetChildrenbyTagName!\ngetChildrenbyTagName\nhasAttributekey\ngetAttribute\nsetAttribute","category":"page"},{"location":"#XMLParser.getElements!","page":"Home","title":"XMLParser.getElements!","text":"getElements!(ret::Vector{XMLElement},xmlel::XMLElement,tagname::String)\n\nPushes all XMLElements that match the tagname to ret. \n\n\n\n\n\n","category":"function"},{"location":"#XMLParser.getElements","page":"Home","title":"XMLParser.getElements","text":"getElements(xmlel::XMLElement,tagname::String)\n\nGets all XMLElements that match the tagname and returns a Vector{XMLElement}. \n\n\n\n\n\n","category":"function"},{"location":"#XMLParser.getChildrenbyTagName!","page":"Home","title":"XMLParser.getChildrenbyTagName!","text":"getChildrenbyTagName!(ret::Vector{XMLElement},xmlel::XMLElement,tagname::String)\n\nPushes all XMLElements that are direct children of xmlel and match the tagname to ret. \n\n\n\n\n\n","category":"function"},{"location":"#XMLParser.getChildrenbyTagName","page":"Home","title":"XMLParser.getChildrenbyTagName","text":"getChildrenbyTagName(xmlel::XMLElement,tagname::String)\n\nGets all XMLElements that are direct children of xmlel and match the tagname. Return a Vector{XMLElement}. \n\n\n\n\n\n","category":"function"},{"location":"#XMLParser.hasAttributekey","page":"Home","title":"XMLParser.hasAttributekey","text":"hasAttributekey(el::XMLElement,key::String))\n\nReturn true if el has a attribute with keyname key. Returns false otherwise. \n\n\n\n\n\n","category":"function"},{"location":"#XMLParser.getAttribute","page":"Home","title":"XMLParser.getAttribute","text":"getAttribute(el::XMLElement,key::String)\n\nReturn attribute value if el has a attribute with keyname key. Returns emptystring otherwise. \n\n\n\n\n\n","category":"function"},{"location":"#XMLParser.setAttribute","page":"Home","title":"XMLParser.setAttribute","text":"setAttribute(el::XMLElement,key::String,val)\n\nSets attribute value val to XML attribute key of XMLElement el.  Returns an error(\"Attribute not found\") if key is not found. Returns nothing otherwise.\n\n\n\n\n\n","category":"function"},{"location":"#IO-Functions","page":"Home","title":"IO-Functions","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"read(::Type{XMLElement}, ::String)\nwriteXMLElement","category":"page"},{"location":"#Base.read-Tuple{Type{XMLElement}, String}","page":"Home","title":"Base.read","text":"Base.read(::Type{XMLElement}, file::String)\n\nReads a XML file in location file. Returns a XMLElement.\n\n\n\n\n\n","category":"method"},{"location":"#XMLParser.writeXMLElement","page":"Home","title":"XMLParser.writeXMLElement","text":"writeXMLElement(f::IOStream, el::XMLElement)\n\nWrites a XMLElement to an IOStream.\n\n\n\n\n\n","category":"function"}]
